import React, { useEffect, useState } from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import RemoveCircleIcon from '@mui/icons-material/RemoveCircle';
import EditIcon from '@mui/icons-material/Edit';
import Button from '@mui/material/Button';

const List=()=>{
return(
    <>
        
        <div className="row justify-content-center">
            <div className="col-lg-8 col-md-10 col-sm-12 table-responsive">
                <table className="table table-stripped table-hover shodow text-light bg-info">
                    <thead>
                        <tr>
                            <th>Name of the Corporate</th>
                            <th>Locations</th>
                            <th>Number of employees</th>
                            <th>Basic salary</th>
                            <th>Services</th>
                            <th>Benchmark's</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {all.map((data,index)=>(
                            <tr>
                                <td onClick={
                                    ()=>{
                                        setRview(true)
                                        reading(data.org)
            
                                    }}>
                                    {data.org}
                                    </td>
                                {/* <td>{data.locations}</td> */}
                                { <td>
                                    {data.locations.map((ele)=>(
                                        <p>{ele}</p>
                                    ))}
                                </td> }
                                <td>{data.employees}</td>
                                <td>{data.basic}</td>
                                {/* <td>{data.services}</td> */}
                                { <td>
                                    {data.services.map((ele)=>(
                                        <p>{ele}</p>
                                    ))}
                                </td> }
                                {/* <td>{data.benchmarks}</td> */}
                                { <td>
                                    {data.benchmarks.map((ele)=>(
                                        <p>{ele}</p>
                                    ))}
                                </td> }
                                
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
        </>

);
    }
    
export default List;
